import {Component, useState} from 'react';

const [loginName, setLoginName] = useState("");
const [loginPW, setLoginPW] = useState("");

class Login extends Component{
    
    constructor(props){
        super(props);
        
    }
    
    render(){
        return (
            <div>
                <label>Đăng nhập</label>
                <input type = "text" placeholder="Nhập tên đăng nhập ..." onChange={(event)=>{setLoginName(event.target.value)}} ></input>
                <input type = "text" placeholder="Nhập mật khẩu..." onChange={(event)=>{setLoginPW(event.target.value)}} ></input>
                <button>Đăng nhập</button>
                <br/>
                <h3>{loginName}</h3>
                <p>{loginPW}</p>
            </div>
            
          );
    }
    
}

export default Login;
